#define IDV_FAST_MATH_ONE_BITS 0x3F800000

///////////////////////////////////////////////////////////////////////  
//  _idv_finv definition
//

// r = 1/p 
#define _idv_finv(r,p)                                                       \
{                                                                            \
    int _i = 2 * IDV_FAST_MATH_ONE_BITS - *(int *)&(p);                      \
    r = *(float *)&_i;                                                       \
    r = r * (2.0f - (p) * r);                                                \
}

///////////////////////////////////////////////////////////////////////  
//  _idv_int definition
//

__forceinline int _idv_int(float fValue)
{
    double dTemp = fValue + c_dIdvFastMathFloatConversionMagicNumber;
    return (*((long*)&dTemp)) - 0x80000000;


//  fValue += (1 << 23);
//  return (*((int*)&fValue)) & 0x7fffff;

//  return int(fValue);
}


///////////////////////////////////////////////////////////////////////  
//  _idv_cosD definition
//

__forceinline float _idv_cosD(float fValueDegrees)
{
    return g_fIdvCosTable[_idv_int(fValueDegrees * c_dIdvFastMathConstantForDegrees) & 4095];
}


///////////////////////////////////////////////////////////////////////  
//  _idv_sinD definition
//

