///////////////////////////////////////////////////////////////////////  
//  _idv_sqrt1 definition
//

__forceinline float _idv_sqrt1(float fVal)
{
    int i = ((*(int*)&fVal) >> 1 ) + 0x1fc00000; 
    return *(float*)&i;
}

